import React, { useState } from "react";
import style from "./Home.module.css"; 

const Home = () => {
  const [showProjectDetail, setShowProjectDetail] = useState(false);

  const toggleProjectDetail = () => {
    setShowProjectDetail(!showProjectDetail);
  };

  return (
    <div className={style.homeContainer}>
      <h1>Bienvenido a mi Portafolio</h1>
      <img
        src={'yo.jpg'}
        alt="Mi Foto de Perfil"
        className={style.profileImage}
        onClick={toggleProjectDetail}
      />
      <p>MI ÚLTIMO TRABAJO</p>
      
      {showProjectDetail && (
        <div className={style.projectDetail}>
          {/* Aquí puedes agregar más imágenes del proyecto */}
          <img src={'projectImage1.jpg'} alt="Proyecto Imagen 1" />
          <img src={'projectImage2.jpg'} alt="Proyecto Imagen 2" />
          <img src={'projectImage3.jpg'} alt="Proyecto Imagen 3" />
          {/* Puedes agregar más imágenes según sea necesario */}
          <button onClick={toggleProjectDetail}>Cerrar</button>
        </div>
      )}
    </div>
  );
};

export default Home;
